import React from 'react'
import './Main.css'
import bookcase from '../img/bookcase_2.png'
import All from '../etc/all.json'

const M_book = () => {

  Object.keys(All.제목).map((bookname)=>{
    console.log(bookname);
  })
  console.log(All.제목[~~(Math.random()*20)]);

  return (
    <div className='center'>
      <div className='bookcase'>
        <img src={bookcase} style={{width:'100%'}}/>
      </div>
      <div className='bookImg'>
        <img />
      </div>
    </div>
  )
}

export default M_book
